import './App.css';
import freecodecampLogo from './imagenes/freecodecamp-logo.png';

function App() {
  return (
    <div className='App'>
      <div clasName='freecodecamp-logo-contenedor'>
        <img 
          src={freecodecampLogo}
          clasName='freecodecamp-logo'
          alt='logo de freecodecampe' />

      </div>
    </div>
  );
}

export default App;
